renderHTML:
__ht__function(data, gv, cache) {
    var scene = './scenes/桥墩一般结构.json';
    if (!cache.htmlView) {
        var g3d = new ht.graph3d.Graph3dView();
        cache.htmlView = g3d.getView();
        cache.htmlView.style.background = '#fff';
        data.g3d = g3d;
        g3d.setMovableFunc(function() { return false;});

        if (data.a('eye')) g3d.setEye(data.a('eye'));
        if (data.a('center')) g3d.setCenter(data.a('center'));
        if (data.a('far')) g3d.setFar(data.a('far'));
        if (data.a('near')) g3d.setNear(data.a('near'));
        if (data.a('scene')) scene = data.a('scene');

        ht.Default.xhrLoad(scene, function(json) {
            g3d.dm().deserialize(json);
        });

        // layoutHTML will be called when the data needs to be drawing
        cache.htmlView.layoutHTML = function() {
            gv.layoutHTML(data, cache.htmlView, true);
            g3d.iv();
        };
    }

    // html for showing
    return cache.htmlView;
}
